import styled from "styled-components";

export const StyledHome = styled.div`
    background: #f8f8f8;
    
    .mensage{
        width: 100%;
        height: 199px;
        background-image: url(https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.galeriadaarquitetura.com.br%2Fprojeto%2Fcoda-arquitetos_%2Fcasa-11%2F5651&psig=AOvVaw2KZc9Wh6PsD_IRCRwiR7FY&ust=1667854132562000&source=images&cd=vfe&ved=0CA0QjRxqFwoTCICz6fq2mvsCFQAAAAAdAAAAABAE);
    }

    .card{
        list-style: none;
        background: #FFFFFF;
        box-shadow: 0px 4px 30px rgba(0, 0, 0, 0.08);
        border-radius: 10px;

        width: 358px;
        height: 474px;
        margin: 30px;
    }

`
